import React from "react"
import { Link } from "react-router-dom"

function Header(props) {
  return (
    <div>
      <h1>Lucidity</h1>
      <div>
        {<Link to="/">home</Link>}
        <Link to="/landing">front page</Link>
      </div>
    </div>
  )
}

export default Header
